    // 显示多张图  
    showimg1: function showimg1(list, index) {
      if (list[index].urlType == 2) {
        // 视频直播
        var roomId = list[index].url;
        wx.navigateTo({
          url: "plugin-private://wx2b03c6e691cd7370/pages/live-player-plugin?room_id=".concat(roomId)
        });
        return false;
      }
      if (list[index].urlType == 1) {
        uni.setStorageSync("webview", list[index].url);
        uni.setStorageSync("webview_webview", list[index]);
        uni.navigateTo({
          url: "/pages3/wbview/wbview"
        });
        return false;
      }
      var imglist = [];
      for (var a = 0; a < list.length; a++) {
        var img = list[a].imagePath;
        if (img.indexOf("http") < 0) {
          img = list[a].imagePath;
        }
        imglist.push(img);
      }
      uni.previewImage({
        urls: imglist,
        current: index
      });
    },
